import React from "react";
import "./styles/Home.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import {allImages} from '../Images/Images';

interface HomeObj{
	Nickname:any,
	setNickname:(value:any)=>void,
	IntraID:any,
	setIntraID:(value:any)=>void
}

const Home = ({ Nickname, setNickname, IntraID, setIntraID }: HomeObj) => {
  const handleNicknameChange = (e:any) => {
    setNickname(e.target.value);
  };
  const handleIntraIDChange = (e:any) => {
    setIntraID(e.target.value);
  };

  sessionStorage.setItem("Nickname", Nickname);
  sessionStorage.setItem("IntraID", IntraID);

  return (
    <div className="Home-container">
      <label><b>ID</b></label>
      <input onChange={handleNicknameChange}></input>

	  <div className="IntraID-container">
		{allImages.map(({value, src}) =>
			<span className="IntraID">
			<input type="radio" name="IntraID" value={value} onChange={handleIntraIDChange} className="IntraID-input"/>
			<img src={src} width="50" height="50" className="IntraID-img"></img>
			</span>
		)}
	  </div>

	  <div className="Join-button">
	  	<a className="btn btn-dark" href="/Lobby"><b>로그인</b></a>
	  </div>
    </div>
  );
};

export default Home;
